import React ,{ Component } from 'react';
import './style.css';
import './iconfont';
import 'bootstrap/dist/css/bootstrap.css';

class Header extends Component{
	render() {
		return(
			<div>
				<div className="row">
					<div class="col-md-5 column">
						<a href="/" className="logo"><img src={require('./tower.png')} /></a>
						<div className="site_name">
							<a href="" className="author">犹游由我待丶</a>
							<p className="desc">学习学习学习</p>
					  </div>
				  </div>
				</div>
				<div className="col-md-7 column">
					<div className="nav_menu">
						<a href="./index.html" className="current">
							<svg class="icon" aria-hidden="true">
  							<use xlinkHref="#icon-shouye1">首页</use>
							</svg>
						</a>
						<a href="./catalog.html"><i className="iconfont icon-archive">归档</i></a>
						<a href=""><i className="iconfont icon-ziyuan">资源</i></a>
						<a href=""><i className="iconfont icon-guanyu">关于</i></a>
						<a href=""><i className="iconfont icon-denglu">登陆</i></a>
						<a href=""><i className="iconfont icon-zhuce">注册</i></a>
					</div>
				</div>
			</div>
		)
	}
}



export default Header;
